2018년 겨울, 오스트리아 빈

빈의 크리스마스 마켓은 유럽 3대 크리스마스 마켓 중 한 곳이에요 🎄 그 명성에 걸맞게 겨울의 빈에는 볼거리와 먹거리가 가득합니다. 가장 유명한 시청 광장 크리스마스 마켓부터 프라터 공원 윈터 마켓까지, 크리스마스 시즌에 열리는 마켓만 약 13개에 달해요. 하이쎄 쇼콜라데(heiße Schokolade; hot chocolate), 글뤼바인(Glühwein), 바움쿠헨(Baumkuchen), 푼치(Punsch; punch), 버블 바펠른(Bubble-Waffeln; bubble waffle)등이 한데 모여 만들어진 크리스마스 향기를 어디서나 즐길 수 있습니다. 마리아 테레지아 광장에서 마신 아이어리쾨어(Eierlikör; eggnog) 맛을 잊을 수 없네요. 꼭 다시 가고 싶어요!

